window.bookSummaryJSON = "<p>Close your eyes and get ready to see the world in a new and more positive way. As a child in Toronto, Molly Burke was diagnosed with retinitis pigmentosa and became completely sightless as a teenager. Now an award-winning YouTube star and global influencer, Molly shares what it’s like to be a purple-haired, pink-obsessed fashion and makeup lover in a seeing world. She speaks with authenticity and candor about how she tackles the preconceived notions we have around blindness; Molly has made it her mission to make us see her - and ourselves- in a wholly empowering way. Learn about her struggles with bullying and anxiety, her quest for inclusivity, how she built a successful influencer business (with more than 1.8 million followers), and what it’s really like to travel with the true star of this audio, her service dog, Gallop.</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library on your web browser, along with the audio.</b>&nbsp;</p>"; 
